  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130306 includes physical
  and profile data collected aboard the Westerly during project OPR-J348-KR-12 in
  the Gulf of Mexico from 2012-05-17 to 2013-01-25. These data include SOUND VELOCITY
  and WATER TEMPERATURE. The instruments used to collect these data include sound
  velocimeter - moving vessel profiler. These data were collected and submitted by
  the NOAA Office of Coast Survey in support of hydrographic multibeam surveys to
